namespace Habitat.Framework.ProjectOxfordAI.Tests
{
  using System;
  using System.Collections.Generic;
  using System.IO;
  using System.Linq;
  using System.Threading.Tasks;
  using FluentAssertions;
  using Habitat.Framework.ProjectOxfordAI.Enums;
  using Habitat.Framework.ProjectOxfordAI.Services;
  using NSubstitute;
  using Xunit;

  public class EmotionsServiceTests
  {

    private const string SubscriptionKey = "2b7889bbf1b242d7af21fa589af49542";

    private const string StringBase64HappyFaceImage = "";

    private const string StringBase64AngryFaceImage = "";

    private const string StringBase64SadnessFaceImage = "";

    [Theory]
    [AutoDbData]
    public void ShouldBeHappyEmotionImageStream()
    {
      IEmotionsService emotionsService = Substitute.For<EmotionsService>(SubscriptionKey);

      MemoryStream faceImage = new MemoryStream(Convert.FromBase64String(StringBase64HappyFaceImage));

      Task<IDictionary<Emotions, float>> task = emotionsService.ReadEmotionsFromImageStreamAndGetRankedEmotions(faceImage);

      IDictionary<Emotions, float> emotionRanksResult = task.GetAwaiter().GetResult();

      emotionRanksResult.ElementAt(0).Key.ShouldBeEquivalentTo(Emotions.Happiness);
    }

    [Theory]
    [AutoDbData]
    public void ShouldBeAngryEmotionImageStream()
    {
      IEmotionsService emotionsService = Substitute.For<EmotionsService>(SubscriptionKey);

      MemoryStream faceImage = new MemoryStream(Convert.FromBase64String(StringBase64AngryFaceImage));

      Task<IDictionary<Emotions, float>> task = emotionsService.ReadEmotionsFromImageStreamAndGetRankedEmotions(faceImage);

      IDictionary<Emotions, float> emotionRanksResult = task.GetAwaiter().GetResult();

      emotionRanksResult.ElementAt(0).Key.ShouldBeEquivalentTo(Emotions.Anger);
    }

    [Theory]
    [AutoDbData]
    public void ShouldBeSadnessEmotionImageStream()
    {
      IEmotionsService emotionsService = Substitute.For<EmotionsService>(SubscriptionKey);

      MemoryStream faceImage = new MemoryStream(Convert.FromBase64String(StringBase64SadnessFaceImage));

      Task<IDictionary<Emotions, float>> task = emotionsService.ReadEmotionsFromImageStreamAndGetRankedEmotions(faceImage);

      IDictionary<Emotions, float> emotionRanksResult = task.GetAwaiter().GetResult();

      emotionRanksResult.ElementAt(0).Key.ShouldBeEquivalentTo(Emotions.Sadness);
    }

  }
}